class Prices extends React.Component {
  state = {
    currency: 'USD',
  };

  render() {
    const { bpiList } = this.props;

    return (
      <div>
        <ul className="list-group">
          {bpiList && bpiList.map((bpi) => (
            <li className="list-group-item">{bpi}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default Prices;
